import React from 'react';
import styled from 'styled-components';
import logoImage from '../assets/Biglogo.png'; // 로고 이미지 경로
import bannerImage from '../assets/banner.png'; // 배너 이미지 경로

const PageContainer = styled.div`
  width: 390px;
  height: 844px;
  background-color: #FFFFFF;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const LogoImage = styled.img`
  width: 300px;
  margin-top: 70px;
  margin-bottom: 30px;
`;

const BannerImage = styled.img`
  width: 90%;
  margin-bottom: 20px;
`;

const Section = styled.div`
  width: 90%;
  margin-bottom: 20px;
`;

const SectionTitle = styled.h2`
  font-size: 18px;
  margin-bottom: 10px;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const More = styled.span`
  font-size: 14px;
  color: #888;
`;

const Card = styled.div`
  background-color: #F8F8F8;
  border-radius: 10px;
  padding: 15px;
`;

const CardItem = styled.div`
  margin-bottom: 10px;
  display: flex;
  justify-content: space-between;
`;

const HeartIcon = styled.span`
  color: #FFD700;
  margin-right: 5px;
`;

const BottomNav = styled.div`
position: absolute;
  bottom: 0;
  width: 390px;
  height: 60px;
  background-color: #ffd9007d;
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

const NavItem = styled.div`
  font-size: 24px;
`;

const MobileMain = () => {
  return (
    <PageContainer>
      <LogoImage src={logoImage} alt="Through World" />
      <BannerImage src={bannerImage} alt="Banner" />

      <Section>
        <SectionTitle>
          국가별 커뮤니티
          <More>more</More>
        </SectionTitle>
        <Card>
          <CardItem>캐나다 게시판</CardItem>
          <CardItem>호주 게시판</CardItem>
          <CardItem>뉴질랜드 게시판</CardItem>
          <CardItem>네덜란드 게시판</CardItem>
        </Card>
      </Section>

      <Section>
        <SectionTitle>
          HOT 게시물
          <More>more</More>
        </SectionTitle>
        <Card>
          <CardItem>
            숙소 구할 때 팁
            <span><HeartIcon>♥</HeartIcon>400</span>
          </CardItem>
          <CardItem>
            밴쿠버 월세 현실
            <span><HeartIcon>♥</HeartIcon>305</span>
          </CardItem>
          <CardItem>
            eSIM 공구 이벤트
            <span><HeartIcon>♥</HeartIcon>164</span>
          </CardItem>
          <CardItem>
            호주 벌레 너무 커..
            <span><HeartIcon>♥</HeartIcon>136</span>
          </CardItem>
        </Card>
      </Section>

      <BottomNav>
        <NavItem>☰</NavItem>
        <NavItem>⌂</NavItem>
        <NavItem>👤</NavItem>
      </BottomNav>
    </PageContainer>
  );
};

export default MobileMain;
